import PostBox from "./PostBox";
import {useSelector} from 'react-redux';


function Posts() { 

const diaries = useSelector((state) => state.diariesReducer);

console.log(diaries);

    return ( 
       <div>
            {
            diaries.map((diary) =>(

            <div key={diary._id}>
                <PostBox diary={diary}/>
            </div> 

            ))
            }
        </div>

    )
}

export default Posts;
